import React from "react";
import Aurora from "./Aurora";
import "./Aurora.css";

function App() {
  return (
    <div>
      <Aurora
        colorStops={["#3A29FF", "#FF94B4", "#FF3232"]}
        blend={0.5}
        amplitude={1.0}
        speed={0.5}
      />
      <div
        style={{
          position: "relative",
          zIndex: 1,
          minHeight: "100vh",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
          color: "white",
          textShadow: "0 2px 8px #000",
        }}
      >
        <h1>Welcome to My Aurora Landing Page</h1>
        <p>This is a beautiful animated background using OGL and GLSL.</p>
      </div>
    </div>
  );
}

export default App;
